import { useState, useEffect, useCallback } from 'react';
import { MEET_LABELS, COMPETITION_POINTS } from './utils/competitionPoints';

function CompetitionTable({ points, eventType, onCalculatePerformance, calculatorForm }) {
  const [basePoints, setBasePoints] = useState('');
  const [baseMeet, setBaseMeet] = useState('');
  const [basePlace, setBasePlace] = useState('');
  const [equivalentPerformances, setEquivalentPerformances] = useState({});

  const getEquivalentPoints = useCallback(() => {
    if (!baseMeet || !basePlace) return 0;
    return COMPETITION_POINTS[baseMeet][basePlace] || 0;
  }, [baseMeet, basePlace]);

  const calculateEquivalentPerformances = useCallback(async () => {
    const results = {};
    const totalPoints = Number(basePoints) + getEquivalentPoints();

    for (const meet of Object.keys(COMPETITION_POINTS)) {
      results[meet] = {};
      for (const place of Object.keys(COMPETITION_POINTS[meet])) {
        const competitionPoints = COMPETITION_POINTS[meet][place];
        const requiredPerformancePoints = totalPoints - competitionPoints;

        if (requiredPerformancePoints > 0) {
          const performance = await onCalculatePerformance(requiredPerformancePoints, eventType);
          results[meet][place] = performance;
        } else {
          results[meet][place] = null;
        }
      }
    }

    setEquivalentPerformances(results);
  }, [basePoints, eventType, getEquivalentPoints, onCalculatePerformance]);

  useEffect(() => {
    if (basePoints && eventType) {
      calculateEquivalentPerformances();
    }
  }, [basePoints, eventType, baseMeet, basePlace, calculateEquivalentPerformances]);

  return (
    <div className="competition-page">
      <div className="competition-sidebar">
        {calculatorForm}
      </div>
      <div className="competition-main">
        <div className="competition-table">
          <div className="baseline-settings">
            <h2>Competition Level Comparison</h2>
            <div className="settings-grid">
              <div className="setting-group">
                <label>Base Points</label>
                <input
                  type="number"
                  value={basePoints}
                  onChange={(e) => setBasePoints(Number(e.target.value))}
                  placeholder="Enter points"
                />
              </div>
              <div className="setting-group">
                <label>Meet Level</label>
                <select value={baseMeet} onChange={(e) => setBaseMeet(e.target.value)}>
                  <option value="">No bonus</option>
                  {Object.keys(MEET_LABELS).map(meet => (
                    <option key={meet} value={meet}>{MEET_LABELS[meet]}</option>
                  ))}
                </select>
              </div>
              {baseMeet && (
                <div className="setting-group">
                  <label>Place</label>
                  <select value={basePlace} onChange={(e) => setBasePlace(e.target.value)}>
                    <option value="">Select place</option>
                    {Object.keys(COMPETITION_POINTS[baseMeet]).map(place => (
                      <option key={place} value={place}>{place}</option>
                    ))}
                  </select>
                </div>
              )}
            </div>
          </div>
          {/* Display equivalent performances */}
          {Object.keys(equivalentPerformances).map(meet => (
            <div key={meet} className="meet-section">
              <h3>{MEET_LABELS[meet]}</h3>
              {Object.entries(equivalentPerformances[meet]).map(([place, performance]) => (
                <div key={place} className="performance-row">
                  <span>{place}:</span>
                  <span>{performance !== null ? performance : 'N/A'}</span>
                </div>
              ))}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default CompetitionTable;
